function [VP,att]=compute_seismic_properties_magma(f,T,phi_l,phi_s,phi_g,rho_l,rho_s,rho_g,eta,K_l,K_s,K_g,CP_l,CP_s,CP_g,alpha_l,alpha_s,alpha_g,kl,ds,dg,g,theta)
% !!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!
% Alex Carrara, University of Washington, Seattle. 
% Contact: carrara.alexandre.univ@gmail.com 
%
% This fonction computes the speed of sound and the associated intrinsic attenuation coefficient in a magma
% This function solve Eq. 28 in Carrara et al., The dispersion of sound in magmas.
%
% List of the arguments:
% f       = Frequency of the perturbation (Hz)
% T       = Initial temperature of the magma (K)
% phi_l   = Volume fraction of liquid in the magma
% phi_s   = Volume fraction of liquid in the magma
% phi_g   = Volume fraction of liquid in the magma
% rho_l   = Density of the liquid phase (kg m-3)
% rho_s   = Density of the solids (kg m-3)
% rho_g   = Density of the gas phase (kg m-3)
% eta     = Dynamic viscosity of the liquid (Pa s)
% K_l     = Bulk modulus of the liquid (Pa)
% K_s     = Bulk modulus of the solids (Pa)
% K_g     = Bulk modulus of the gas (Pa)
% CP_l    = Specific heat capacity of the liquid at a constant pressure (J kg-1 K-1)
% CP_s    = Specific heat capacity of the liquid at a constant pressure (J kg-1 K-1)
% CP_g    = Specific heat capacity of the liquid at a constant pressure (J kg-1 K-1)
% alpha_l = Coefficient of thermal expansion of the liquid (K-1)
% alpha_s = Coefficient of thermal expansion of the solids (K-1)
% alpha_g = Coefficient of thermal expansion of the gas (K-1)
% kl      = Thermal condictivity og the liquid phase (W m-1 K-1)
% ds      = Diameter of the solids (m)
% dg      = Diameter of the gas bubbles (m)
% g       = Gravitational acceleration (negative m s-2)
% theta   = Angle of incidence of the wave (degree)
%
% WARNING: with very low or very high frequencies and very high viscosities of the liquid phase, this code has issues with the machine precision 

    if phi_l==1.0 % pure liquid
        [VP,att]=solve_one_phase_liquid(f,0,T,phi_l,rho_l,eta,K_l,CP_l,alpha_l,kl,g,theta);
      elseif phi_g==0.0 % solids in liquid
        [VP,att]=solve_two_phases_solids(f,0,T,phi_l,phi_s,rho_l,rho_s,eta,K_l,K_s,CP_l,CP_s,alpha_l,alpha_s,kl,ds,g,theta);
      elseif phi_s==0.0 % gas in liquid
        [VP,att]=solve_two_phases_gaz(f,0,T,phi_l,phi_g,rho_l,rho_g,eta,K_l,K_g,CP_l,CP_g,alpha_l,alpha_g,kl,dg,g,theta);
      else % gas and solids in liquid
        [VP,att]=solve_three_phases(f,0,T,phi_l,phi_s,phi_g,rho_l,rho_s,rho_g,eta,K_l,K_s,K_g,CP_l,CP_s,CP_g,alpha_l,alpha_s,alpha_g,kl,ds,dg,g,theta);
    end
end  


function [VP,att]=solve_one_phase_liquid(f,P,T,phi_l,rho_l,eta,K_l,CP_l,alpha_l,kl,g,theta)
  omega = 2*pi*f;
  AA=-omega*phi_l;
  AC=phi_l*rho_l;
  AJ=phi_l*g*sind(theta);
  AK=7/3*eta*phi_l;
  AL=0;
  AM=-omega*rho_l*phi_l;
  AP=phi_l;
  BB=phi_l*rho_l*g*sind(theta);
  BC=phi_l*P;
  BD=-phi_l*kl;
  BE=0;
  BF=-omega*phi_l*(rho_l*CP_l-P*alpha_l);
  BI=-omega*phi_l*(P/K_l-T*alpha_l);
  BV=alpha_l*rho_l;
  BW=-rho_l/K_l;
  CP=-1i*AA*AM*BF*BW-AA*AL*BF*BW-AA*AM*BE*BW+1i*AA*AL*BE*BW+1i*AA*AM*BI*BV+AA*AL*BI*BV;
  CB=AC*AJ*BF*BW-1i*AC*AJ*BE*BW-AC*AJ*BI*BV-AA*AP*BB*BV;
  CC=-AA*AK*BF*BW+1i*AA*AK*BE*BW-AA*AM*BD*BW+1i*AA*AL*BD*BW+AA*AK*BI*BV-1i*AA*AP*BC*BV-1i*AC*AP*BF-AC*AP*BE;
  CD=-1i*AC*AJ*BD*BW;
  CE=1i*AA*AK*BD*BW-AC*AP*BD;
  res=roots([CE,CD,CC,CB,CP]);
  if(abs(real(res(3)))==real(res(3)))
  VP = omega./(real(res(3)));
  att = imag(res(3));
  else
  VP = omega./(real(res(4)));
  att = imag(res(4));
  end
end


function [VP,att]=solve_two_phases_solids(f,P,T,phi_l,phi_s,rho_l,rho_s,eta,K_l,K_s,CP_l,CP_s,alpha_l,alpha_s,kl,ds,g,theta)
  omega = 2*pi*f;
  if phi_l<(25/28)
    beta_fs=(150*phi_s*eta)/(phi_l*ds.^2);
  else
    beta_fs=(18*eta*phi_s)/(ds.^2);
  end
  j=1-(phi_s/0.64)^(1/3);
  %A = (3*cos(acos(sqrt(2/3))))/(2*j)-log(j)*sin(acos(sqrt(2/3)));
  A = 0;
  Nu=7-10*phi_l+5*(phi_l.^2);
  gamma_fs=(6*kl*phi_s*Nu)/(ds.^2);

  
  AA=-omega*phi_l;
  AB=-omega*rho_l;
  AC=phi_l*rho_l;
  AD=-omega*phi_s;
  AE=-omega*rho_s;
  AF=phi_s*rho_s;
  AJ=phi_l*g*sind(theta);
  AK=7/3*eta*phi_l;
  AL=beta_fs;
  AM=-omega*rho_l*phi_l;
  AN=-beta_fs;
  AP=phi_l;
  AQ=phi_s*g*sind(theta);
  AR=-beta_fs;
  AS=(6*eta*A*(j/2+1)^2)/rho_s;
  AT=beta_fs;
  AU=-omega*rho_s*phi_s;
  AV=phi_s;
  BB=phi_l*rho_l*g*sind(theta);
  BC=phi_l*P;
  BD=-phi_l*kl;
  BE=gamma_fs;
  BF=-omega*phi_l*(rho_l*CP_l-P*alpha_l);
  BG=-gamma_fs;
  BI=-omega*phi_l*(P/K_l-T*alpha_l);
  BJ=phi_s*rho_s*g*sind(theta);
  BK=phi_s*P;
  BL=-gamma_fs;
  BM=gamma_fs;
  BN=-omega*phi_s*(rho_s*CP_s-P*alpha_s);
  BO=-omega*phi_s*(P/K_s-T*alpha_s);
  BV=alpha_l*rho_l;
  BW=-rho_l/K_l;
  BX=alpha_s*rho_s;
  BY=-rho_s/K_s;
  
  CP=AB*AD*AJ*AU*BB*BN*BV*BY-1i*AB*AD*AJ*AT*BB*BN*BV*BY-1i*AA*AE*AN*AQ*BB*BN*BV*BY-1i*AB*AD*AJ*AU*BB*BM*BV*BY-AB*AD*AJ*AT*BB*BM*BV*BY-AA*AE*AN*AQ*BB*BM*BV*BY-AB*AD*AJ*AR*BG*BJ*BV*BY-1i*AA*AE*AM*AQ*BG*BJ*BV*BY-AA*AE*AL*AQ*BG*BJ*BV*BY-AB*AD*AM*AU*BF*BN*BY+1i*AB*AD*AL*AU*BF*BN*BY+1i*AB*AD*AM*AT*BF*BN*BY+AB*AD*AL*AT*BF*BN*BY-AB*AD*AN*AR*BF*BN*BY+1i*AB*AD*AM*AU*BE*BN*BY+AB*AD*AL*AU*BE*BN*BY+AB*AD*AM*AT*BE*BN*BY-1i*AB*AD*AL*AT*BE*BN*BY+1i*AB*AD*AN*AR*BE*BN*BY+1i*AB*AD*AM*AU*BF*BM*BY+AB*AD*AL*AU*BF*BM*BY+AB*AD*AM*AT*BF*BM*BY-1i*AB*AD*AL*AT*BF*BM*BY+1i*AB*AD*AN*AR*BF*BM*BY+AB*AD*AM*AU*BE*BM*BY-1i*AB*AD*AL*AU*BE*BM*BY-1i*AB*AD*AM*AT*BE*BM*BY-AB*AD*AL*AT*BE*BM*BY+AB*AD*AN*AR*BE*BM*BY-AB*AD*AM*AU*BG*BL*BY+1i*AB*AD*AL*AU*BG*BL*BY+1i*AB*AD*AM*AT*BG*BL*BY+AB*AD*AL*AT*BG*BL*BY-AB*AD*AN*AR*BG*BL*BY-1i*AB*AD*AJ*AU*BB*BL*BW*BX-AB*AD*AJ*AT*BB*BL*BW*BX-AA*AE*AN*AQ*BB*BL*BW*BX-1i*AB*AD*AJ*AR*BF*BJ*BW*BX+AA*AE*AM*AQ*BF*BJ*BW*BX-1i*AA*AE*AL*AQ*BF*BJ*BW*BX-AB*AD*AJ*AR*BE*BJ*BW*BX-1i*AA*AE*AM*AQ*BE*BJ*BW*BX-AA*AE*AL*AQ*BE*BJ*BW*BX-AB*AD*AJ*AU*BB*BO*BV*BX+1i*AB*AD*AJ*AT*BB*BO*BV*BX+1i*AA*AE*AN*AQ*BB*BO*BV*BX+1i*AB*AD*AJ*AR*BI*BJ*BV*BX-AA*AE*AM*AQ*BI*BJ*BV*BX+1i*AA*AE*AL*AQ*BI*BJ*BV*BX+AB*AD*AM*AU*BF*BO*BX-1i*AB*AD*AL*AU*BF*BO*BX-1i*AB*AD*AM*AT*BF*BO*BX-AB*AD*AL*AT*BF*BO*BX+AB*AD*AN*AR*BF*BO*BX-1i*AB*AD*AM*AU*BE*BO*BX-AB*AD*AL*AU*BE*BO*BX-AB*AD*AM*AT*BE*BO*BX+1i*AB*AD*AL*AT*BE*BO*BX-1i*AB*AD*AN*AR*BE*BO*BX+1i*AB*AD*AM*AU*BI*BL*BX+AB*AD*AL*AU*BI*BL*BX+AB*AD*AM*AT*BI*BL*BX-1i*AB*AD*AL*AT*BI*BL*BX+1i*AB*AD*AN*AR*BI*BL*BX-AA*AE*AM*AU*BF*BN*BW+1i*AA*AE*AL*AU*BF*BN*BW+1i*AA*AE*AM*AT*BF*BN*BW+AA*AE*AL*AT*BF*BN*BW-AA*AE*AN*AR*BF*BN*BW+1i*AA*AE*AM*AU*BE*BN*BW+AA*AE*AL*AU*BE*BN*BW+AA*AE*AM*AT*BE*BN*BW-1i*AA*AE*AL*AT*BE*BN*BW+1i*AA*AE*AN*AR*BE*BN*BW+1i*AA*AE*AM*AU*BF*BM*BW+AA*AE*AL*AU*BF*BM*BW+AA*AE*AM*AT*BF*BM*BW-1i*AA*AE*AL*AT*BF*BM*BW+1i*AA*AE*AN*AR*BF*BM*BW+AA*AE*AM*AU*BE*BM*BW-1i*AA*AE*AL*AU*BE*BM*BW-1i*AA*AE*AM*AT*BE*BM*BW-AA*AE*AL*AT*BE*BM*BW+AA*AE*AN*AR*BE*BM*BW-AA*AE*AM*AU*BG*BL*BW+1i*AA*AE*AL*AU*BG*BL*BW+1i*AA*AE*AM*AT*BG*BL*BW+AA*AE*AL*AT*BG*BL*BW-AA*AE*AN*AR*BG*BL*BW+1i*AA*AE*AM*AU*BG*BO*BV+AA*AE*AL*AU*BG*BO*BV+AA*AE*AM*AT*BG*BO*BV-1i*AA*AE*AL*AT*BG*BO*BV+1i*AA*AE*AN*AR*BG*BO*BV+AA*AE*AM*AU*BI*BN*BV-1i*AA*AE*AL*AU*BI*BN*BV-1i*AA*AE*AM*AT*BI*BN*BV-AA*AE*AL*AT*BI*BN*BV+AA*AE*AN*AR*BI*BN*BV-1i*AA*AE*AM*AU*BI*BM*BV-AA*AE*AL*AU*BI*BM*BV-AA*AE*AM*AT*BI*BM*BV+1i*AA*AE*AL*AT*BI*BM*BV-1i*AA*AE*AN*AR*BI*BM*BV;
  CB=1i*AB*AD*AJ*AU*BC*BN*BV*BY+AB*AD*AJ*AT*BC*BN*BV*BY+AA*AE*AN*AQ*BC*BN*BV*BY+1i*AB*AF*AJ*AQ*BB*BN*BV*BY+AB*AD*AJ*AU*BC*BM*BV*BY-1i*AB*AD*AJ*AT*BC*BM*BV*BY-1i*AA*AE*AN*AQ*BC*BM*BV*BY+AB*AF*AJ*AQ*BB*BM*BV*BY-1i*AB*AD*AJ*AR*BG*BK*BV*BY+AA*AE*AM*AQ*BG*BK*BV*BY-1i*AA*AE*AL*AQ*BG*BK*BV*BY+AC*AE*AJ*AQ*BG*BJ*BV*BY+AC*AE*AN*AQ*BF*BN*BY-1i*AB*AF*AM*AQ*BF*BN*BY-AB*AF*AL*AQ*BF*BN*BY-1i*AC*AE*AN*AQ*BE*BN*BY-AB*AF*AM*AQ*BE*BN*BY+1i*AB*AF*AL*AQ*BE*BN*BY-1i*AC*AE*AN*AQ*BF*BM*BY-AB*AF*AM*AQ*BF*BM*BY+1i*AB*AF*AL*AQ*BF*BM*BY-AC*AE*AN*AQ*BE*BM*BY+1i*AB*AF*AM*AQ*BE*BM*BY+AB*AF*AL*AQ*BE*BM*BY+AC*AE*AN*AQ*BG*BL*BY-1i*AB*AF*AM*AQ*BG*BL*BY-AB*AF*AL*AQ*BG*BL*BY+AB*AD*AJ*AU*BC*BL*BW*BX-1i*AB*AD*AJ*AT*BC*BL*BW*BX-1i*AA*AE*AN*AQ*BC*BL*BW*BX+AB*AF*AJ*AQ*BB*BL*BW*BX+AB*AD*AJ*AR*BF*BK*BW*BX+1i*AA*AE*AM*AQ*BF*BK*BW*BX+AA*AE*AL*AQ*BF*BK*BW*BX-1i*AB*AD*AJ*AR*BE*BK*BW*BX+AA*AE*AM*AQ*BE*BK*BW*BX-1i*AA*AE*AL*AQ*BE*BK*BW*BX+1i*AC*AE*AJ*AQ*BF*BJ*BW*BX+AC*AE*AJ*AQ*BE*BJ*BW*BX-1i*AB*AD*AJ*AU*BC*BO*BV*BX-AB*AD*AJ*AT*BC*BO*BV*BX-AA*AE*AN*AQ*BC*BO*BV*BX-1i*AB*AF*AJ*AQ*BB*BO*BV*BX-AB*AD*AJ*AR*BI*BK*BV*BX-1i*AA*AE*AM*AQ*BI*BK*BV*BX-AA*AE*AL*AQ*BI*BK*BV*BX-1i*AC*AE*AJ*AQ*BI*BJ*BV*BX-1i*AB*AD*AJ*AV*BB*BJ*BV*BX-1i*AA*AE*AP*AQ*BB*BJ*BV*BX-AC*AE*AN*AQ*BF*BO*BX+1i*AB*AF*AM*AQ*BF*BO*BX+AB*AF*AL*AQ*BF*BO*BX+1i*AC*AE*AN*AQ*BE*BO*BX+AB*AF*AM*AQ*BE*BO*BX-1i*AB*AF*AL*AQ*BE*BO*BX-1i*AC*AE*AN*AQ*BI*BL*BX-AB*AF*AM*AQ*BI*BL*BX+1i*AB*AF*AL*AQ*BI*BL*BX-1i*AB*AD*AN*AV*BB*BL*BX-AB*AD*AP*AU*BB*BL*BX+1i*AB*AD*AP*AT*BB*BL*BX+1i*AB*AD*AM*AV*BF*BJ*BX+AB*AD*AL*AV*BF*BJ*BX-AB*AD*AP*AR*BF*BJ*BX+AB*AD*AM*AV*BE*BJ*BX-1i*AB*AD*AL*AV*BE*BJ*BX+1i*AB*AD*AP*AR*BE*BJ*BX-1i*AC*AE*AJ*AU*BF*BN*BW-AC*AE*AJ*AT*BF*BN*BW+AB*AF*AJ*AR*BF*BN*BW-AC*AE*AJ*AU*BE*BN*BW+1i*AC*AE*AJ*AT*BE*BN*BW-1i*AB*AF*AJ*AR*BE*BN*BW-AC*AE*AJ*AU*BF*BM*BW+1i*AC*AE*AJ*AT*BF*BM*BW-1i*AB*AF*AJ*AR*BF*BM*BW+1i*AC*AE*AJ*AU*BE*BM*BW+AC*AE*AJ*AT*BE*BM*BW-AB*AF*AJ*AR*BE*BM*BW-1i*AC*AE*AJ*AU*BG*BL*BW-AC*AE*AJ*AT*BG*BL*BW+AB*AF*AJ*AR*BG*BL*BW-AC*AE*AJ*AU*BG*BO*BV+1i*AC*AE*AJ*AT*BG*BO*BV-