function [VP,att]=solve_three_phases(f,P,T,phi_l,phi_s,phi_g,rho_l,rho_s,rho_g,eta,K_l,K_s,K_g,CP_l,CP_s,CP_g,alpha_l,alpha_s,alpha_g,kl,ds,dg,g,theta)
  omega = 2*pi*f;
  if phi_l<(25/28)
    beta_fs=(150*phi_s*eta)/(phi_l*ds.^2);
    beta_fg=(150*phi_g*eta)/(phi_l*dg.^2);
  else
    beta_fs=(18*eta*phi_s)/(ds.^2);
    beta_fg=(18*eta*phi_g)/(dg.^2);
  end
  j=1-(phi_s/0.64)^(1/3);
  A = (3*cos(acos(sqrt(2/3))))/(2*j)-log(j)*sin(acos(sqrt(2/3)));
  %A = 0;
  Nu=7-10*phi_l+5*(phi_l.^2);
  gamma_fs=(6*kl*phi_s*Nu)/(ds.^2);
  gamma_fg= (6*kl*phi_g*Nu)/(dg.^2);
  
  AA=omega*phi_l;
  AB=omega*rho_l;
  AC=phi_l*rho_l;
  AD=omega*phi_s;
  AE=omega*rho_s;
  AF=phi_s*rho_s;
  AG=omega*phi_g;
  AH=omega*rho_g;
  AI=phi_g*rho_g;
  AJ=phi_l*g*sind(theta);
  AK=7/3*eta*phi_l;
  AL=beta_fs+beta_fg;
  AM=omega*rho_l*phi_l;
  AN=-beta_fs;
  AO=-beta_fg;
  AP=phi_l;
  AQ=phi_s*g*sind(theta);
  AR=-beta_fs;
  AS=(6*eta*A*(j/2+1)^2)/rho_s;
  AT=beta_fs;
  AU=omega*rho_s*phi_s;
  AV=phi_s;
  AW=phi_g*g*sind(theta);
  AX=-beta_fg;
  AY=beta_fg;
  AZ=omega*rho_g*phi_g;
  BA=phi_g;
  BB=phi_l*rho_l*g*sind(theta);
  BC=phi_l*P;
  BD=phi_l*kl;
  BE=gamma_fs+gamma_fg;
  BF=omega*phi_l*(rho_l*CP_l-P*alpha_l);
  BG=-gamma_fs;
  BH=-gamma_fg;
  BI=omega*phi_l*(P/K_l-T*alpha_l);
  BJ=phi_s*rho_s*g*sind(theta);
  BK=phi_s*P;
  BL=-gamma_fs;
  BM=gamma_fs;
  BN=omega*phi_s*(rho_s*CP_s-P*alpha_s);
  BO=omega*phi_s*(P/K_s-T*alpha_s);
  BP=phi_g*rho_g*g*sind(theta);
  BQ=phi_g*P;
  BR=-gamma_fg;
  BS=gamma_fg;
  BT=omega*phi_g*(rho_g*CP_g-P*alpha_g);
  BU=omega*phi_g*(P/K_g-T*alpha_g);
  BV=alpha_l*rho_l;
  BW=rho_l/K_l;
  BX=alpha_s*rho_s;
  BY=rho_s/K_s;
